import React, { useEffect, useState } from 'react'
import axios from 'axios';
const posts = () => {
  const[data,setData]= useState([]);
  useEffect(()=>{
        const getData = async ()=>{
          const response = await axios.get('https://newsapi.org/v2/top-headlines?country=us&apiKey=a612a032fc214df2962a6fcd6d4fe944')
          const data = response.json();
          setData(data);
        }
        getData();
  },[])
  console.log(data);
  return (
    <div></div>
  )
}

export default posts
